        <td><th>Remaining</th></td>
        <td><th>Deadline</th></td>
        <td><th>Pay</th></td>
      </tr>
    </thead>
    <tbody>

 {
    BillData.map((doc,index)=>{
        return(
        <ShowBills
        bill_id={doc.bill_id}

        amount={doc.amount}

        deadline={doc.deadline}
        remainingAmount={doc.remaining}
          paid={doc.paid}
          description={doc.description}
        key={index}
        index={index}
        parts={doc.parts}

        />
    )
    })

 }  
       </tbody>
       </table></div></div></div>
       <Footer/>
       </>
    );
}

export default Pay;

